                        }
                    }
                    obj.Persistent.RemoveWhere(i => keys.Contains(i.FormKey));
                    obj.Temporary.RemoveWhere(i => keys.Contains(i.FormKey));
                    obj.VisibleWhenDistant.RemoveWhere(i => keys.Contains(i.FormKey));
                    break;
                case "PlacedCreature":
                case "IPlacedCreatureGetter":
